import logo from './logo.svg';
import './App.css';

function App() {

const objeto = {
  tipo: 'vehículo',
  marca: 'mercedes benz',
  modelo: 'c-200',
  anio: '2019'
}

console.log (objeto)

const nuevoObjeto = {
  ...objeto,
  anio: '2020'
}

let a, b, rest 
[a, b, ...rest] = [10, 20, 30, 40, 50]
console.log (a)
console.log (b)

console.log (nuevoObjeto)

const números = [1, 2, 3, 4]
console.log (números)

const nuevoNumeros = [...números, 5, 6]
console.log (nuevoNumeros)
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
